class Backend():
	
	def temizle():
		sil = open('urun_bilgi.txt', 'w')
		sil.write("")
		sil.close()
	
	
	def urunAra(self):
		print("Sa WORLD")
		

	def veriTabani(self):
		vt = firebase.FirebaseApplication('https://cyberinnovacavlak.firebaseio.com/', None)
		anahtarListe = list(vt.get('/cyberinnovacavlak/urun','').keys())
		Backend.temizle()
		
		urunSira = 1
		for i in anahtarListe:
			urunBilgi =list(vt.get('/cyberinnovacavlak/urun/{}'.format(i),'').values())
			
			
			urunIsim = urunBilgi[0]
			urunStok = urunBilgi[1]
			urunStokKod = urunBilgi[2]
			
			
			with open("urun_bilgi.txt","a",encoding="utf-8") as dosya:
			
				dosya.write(str(urunSira) + "\n")
				dosya.write(urunIsim + "\n")
				dosya.write(urunStok + "\n")
				dosya.write(urunStokKod + "\n")
			
			print("Ürün İsmi = ",urunIsim)
			print("Ürün Stok = ",urunStok)
			print("Ürün Stok Kodu = ",urunStokKod)
			
			urunSira = urunSira + 1
			
